import React, { useEffect, useState } from "react";
import "./app.css";
import Videos from "./components/video_list";

function App() {
  const [videos, setVideos] = useState([]);
  useEffect(() => {
    const requestOptions = {
      method: "GET",
      redirect: "follow",
    };

    fetch(
      "https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=25&key=AIzaSyDSxEGaqSRG4_dpbz7TErddujEesi8iVgA",
      requestOptions
    )
      .then((response) => response.json())
      .then((result) => console.log(result.items))
      .catch((error) => console.log("error", error));
  }, []);
  return <h1>hello!</h1>;
}

export default App;
